import React from 'react';
import {icons, Modal} from 'react-materialize';

class TodoListCard extends React.Component {
    render() {
        let card = {width: "auto"}
        console.log("TodoListCard, todoList.id: " + this.props.Wireframe.title);
        let del = {position: "relative", left: "-40px", top: "60px"}
        return (
            <div>
            <i href = "#ConfirmDelete"class = "material-icons modal-trigger" data-target = "ConfirmDelete" style = {del} >close</i>
            <div className="card z-depth-2 rounded grey lighten-4 todo-list-link hoverable" style = {card}>
                <div className="card-content grey-text text-darken-4 item_card">
                    {this.props.Wireframe.title}
                </div>
            </div>
            <div class = "modal" id = "ConfirmDelete">
                <div class = "modal-footer">
                 <a class="waves-effect waves-light grey btn modal-close">No</a>
                 </div>
            </div>
            </div>
        );
    }
}
export default TodoListCard;
